import React, { Component, Fragment } from 'react';

class Notfound extends Component{

    render (){
        return (
            <Fragment>
                <div style={{textAlign: 'center', marginTop: '200px'}}>
                   <h1>Not Found 404</h1>
                </div>
            </Fragment>
        )
    }
}
export default Notfound;
